import YouTubeComp from '../../component/YouTubeComp/YouTubeComp';

class Home extends Component {
    render(){

        return(
            <div>
                <p>Props Materi</p>

                <hr></hr>
                <YouTubeComp 
                time="11.19" 
                title="Tutorail 1"   
                desc="Deatail 1C"/>   
                
                <YouTubeComp  
                time='9.10' 
                title="Tutorail 1"   
                desc="Deatail 2C"/>    
                
                <YouTubeComp  
                time="10.10" 
                title="Tutorail 1"  
                desc="Deatail 3C"/>    
                
                <YouTubeComp  />    
            </div>
          
           )
    }                                                                                                                                                                                                                                                               
}

export default Home;
